// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

import "./CLHouse.sol";


/// @title Crypto League House Factory
/// @notice Config, create and deploy CLHouses
/// @dev This contract is the only way to create CLH
/// @author Leonardo Urrego
contract CLFactory {
    /// @notice Event when house is created
    /// @param houseAddr Address of the created house
    /// @param houseName Name of the created house
    /// @param houseId Id on arrCLH of the created house
    event evtHouseCreation( address houseAddr, string houseName, uint256 houseId );

    /// @notice Array to store all the created houses
	CLHouse[] public arrCLH;

    /// @notice Store the number of houses created
    uint256 public numCLH = 0;

    /// @notice Relation houseAddr with houseId
    mapping( address => uint256 ) public mapCLHId;

    /// @notice Contract with the CLH Constructor logic
    address CLLConstructorCLH;

    /// @notice Contract with the functions for user management
    address CLLUserManagement;

    /// @notice Contract with the functions for Governance
    address CLLGovernance;

    /// @notice Contract CLHouse API
    address CLHAPI;


    /// @notice Config the CLFactory with the CL Logic Contracts
    /// @param _CLLUserManagement Address Contract Logic for user management
    /// @param _CLLGovernance Address Contract Logic for governance
    /// @param _CLLConstructorCLH Address Contract with the Constructor logic
    /// @dev The constructor create a default CLH with the houseId #0
    constructor(
        address _CLLUserManagement,
        address _CLLGovernance,
        address _CLLConstructorCLH,
        address _CLHAPI
    )
    {
        CLLUserManagement = _CLLUserManagement;
        CLLGovernance = _CLLGovernance;
        CLLConstructorCLH = _CLLConstructorCLH;
        CLHAPI = _CLHAPI;

        address[] memory _ManagerWallets = new address[] ( 3 );
        _ManagerWallets[0] = address( 0xc27480520A875bCa3874df1f533523E9ffdb1af9 ) ;
        _ManagerWallets[1] = address( 0x012775f98FDb33656f240A97f73a61f6B8C25756 ) ;
        _ManagerWallets[2] = address( 0xa7b59F12F19b96cc67f19eF017Cf9a0928910fD5 ) ;

        CreateCLH( {
            _houseName: "CLH #0",
            _housePrivate: false,
            _govModel: __GOV_COMMITTEE__,
            _govRules: [ 99, 10, 51 ],
            _ManagerWallets: _ManagerWallets,
            _signerWallet: address( 0 ),
            _signature: ""
        } );

        numCLH--;
    }


    /// @notice Deploy a new CLHouse
    /// @param _houseName Name of the CLH
    /// @param _housePrivate If is set to 1, the CLH is set to private
    /// @param _govModel keccak256 hash of the governance model, see the __GOV_* constans
    /// @param _govRules Array for goverment rules see `enum gRule`
    /// @param _ManagerWallets Whitelist of address for invitate as managers
    /// @dev Some parameters wil be ignored depending on the governance model
    function CreateCLH(
        string memory _houseName,
        bool _housePrivate,
        bytes32 _govModel,
        uint8[3] memory _govRules,
        address[] memory _ManagerWallets,
        address _signerWallet,
        bytes memory _signature
    ) 
        public
        returns( address )
    {
        CLHouse daoCLH;
        address houseOwner = msg.sender;

        require( 
            __GOV_DICTATORSHIP__ == _govModel ||
            __GOV_COMMITTEE__ == _govModel ||
            __GOV_SIMPLE_MAJORITY__ == _govModel ,
            "Invalid Governance Type"
        );

        if( _signerWallet != address(0) ) {
            require( _signature.length == 65, "CreateCLH: Bad signature length" );

            require(
                _signerWallet == CLHouseApi( CLHAPI ).SignerOCNewCLH(
                    _houseName,
                    _housePrivate,
                    _govModel,
                    _govRules[0], // _govRuleMaxUsers,
                    _govRules[1], // _govRuleMaxManagers,
                    _govRules[2], // _govRuleApprovPercentage,
                    _ManagerWallets[0],
                    address(this),
                    _signature
                ),
                "CreateCLH: Invalid Signature"
            );

            houseOwner = _signerWallet;
        }

        daoCLH = ( new CLHouse )
        ( {
            _owner: houseOwner,
            _houseName: _houseName,
            _housePrivate: _housePrivate,
            _govModel: _govModel,
            _govRules: _govRules,
            _CLC: [ CLLUserManagement, CLLGovernance, CLLConstructorCLH, CLHAPI ],
            _ManagerWallets: _ManagerWallets
        } );

        address adrCLH = address( daoCLH );
        uint256 houseId = arrCLH.length;
        arrCLH.push( daoCLH );
        numCLH++;
        mapCLHId[ adrCLH ] = houseId;

        emit evtHouseCreation( adrCLH, _houseName, houseId );

        return adrCLH;
    }


    /// @notice Return the list of all houses created by the factory
    /// @return Array with address houses
    function GetHouseList()
        external
        view
        returns(
            CLHouse[] memory
        )
    {
        return arrCLH;
    }


    /// @notice List of membership houses of the one wallet address
    /// @param _walletAddr User wallet address
    /// @return Array with address houses
    function GetHousesByUser(
        address _walletAddr
    )
        external
        view
        returns(
            address[] memory
        )
    {
        address[] memory arrHouses = new address[] ( arrCLH.length );
        uint256 indexarr = 0;
        for( uint256 did = 1 ; did <= numCLH ; did++ )
            if( 0 != arrCLH[ did ].mapIdUser( _walletAddr ) )
                arrHouses[ indexarr++ ] = address( arrCLH[ did ] ) ;

        return arrHouses;
    }


    /// @notice List of houses that have an invitation pending for a specific wallet
    /// @param _walletAddr The user wallet address
    /// @return Array with address houses
    function GetInvitationsByUser(
        address _walletAddr
    )
        external
        view
        returns(
            address[] memory
        )
    {
        address[] memory arrHouses = new address[] ( arrCLH.length );
        uint256 indexarr = 0;
        for( uint256 did = 1 ; did <= numCLH ; did++ )
            if( 0 != arrCLH[ did ].mapInvitationUser( _walletAddr ) )
                arrHouses[ indexarr++ ] = address( arrCLH[ did ] ) ;

        return arrHouses;
    }
}
